import React from 'react';

interface Props {
    data?: {}
};

const Journals: React.FC<Props> = (props) => {
    const results: any = props.data;
    console.log(results);
    return (
        <>
            <div>{results.map((el: any) => el.source)}</div>
        </>
    );
};

export default Journals;
